import React, { Fragment } from "react";
import { Link } from "react-router-dom";
import repositorio from "./../../../components/img/Respositores";

const StartProject = () => {
  return (
    <Fragment>
      <ul>
        <li>
          <Link to="/">Inicio</Link>
        </li>
      </ul>
      <ol>
        Empezar un proyecto:
        <ol>
          Acudir a tus repositorios de git
          <br>
            <img
              src={require(repositorio)}
              alt="fragmento de las opciones de git dentro de repositorio"
            />
          </br>
        </ol>
        <ol>Clicar al button azul "New"</ol>
      </ol>
    </Fragment>
  );
};

export default StartProject;
